import React from "react";
import { Link } from "react-router-dom";
import { Navbar, Nav, Form, FormControl, Button } from "react-bootstrap";

const NavBar = () => {
  return (
    <Navbar bg="dark" variant="dark">
      <Navbar.Link href=""><Link className="nav-brand" to="/">Made In Sri Lanka</Link></Navbar.Link>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="mr-auto">
          <Nav.Link><Link className="nav-link" to="!#">Developers</Link></Nav.Link>
          <Nav.Link><Link className="nav-link" to="/register">Register</Link></Nav.Link>
          <Nav.Link><Link className="nav-link" to="/login">Login</Link></Nav.Link>
        </Nav>
        <Form inline>
          <FormControl type="text" placeholder="Search" className=" form-control-sm mr-sm-2" />
          <Button variant="outline-primary" className="btn-sm">Search</Button>
        </Form>
      </Navbar.Collapse>
    </Navbar>

    // <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
    //   <Link className="navbar-brand" to="/"><i className="fas fa-code"></i> DevConnector</Link>

    //   <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
    //     <span class="navbar-toggler-icon"></span>
    //   </button>

    //   <div className="collapse navbar-collapse" id="navbarSupportedContent">
    //     <ul className="navbar-nav ml-auto">
    //       <li className="nav-item"><Link className="nav-link" to="!#">Developers</Link></li>
    //       <li className="nav-item"><Link className="nav-link" to="/register">Register</Link></li>
    //       <li className="nav-item"><Link className="nav-link" to="/login">Login</Link></li>
    //     </ul>
    //   </div>

    //   <form class="form-inline my-2 my-lg-0 ml-auto">
    //     <input class="form-control form-control-sm mr-sm-2" type="search" placeholder="Search" aria-label="Search" />
    //     <button class="btn btn-sm btn-outline-primary my-2 my-sm-0" type="submit">Search</button>
    //   </form>
    // </nav>
  );
};

export default NavBar;
